import React from 'react';
import styled from 'styled-components';


import { NavLink } from 'react-router-dom';
import {Div} from '../styles/DefaultStyles';

import IconTools from '../svgs/basic/IconTools';



const DivHome = styled(Div)`

  width: 100%;
  height:100%;

  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;

`;


const NavLinkNavItem = styled(NavLink)`
  width: 90%;
  height: auto;


	color: ${props => props.theme.color_normal};
	font-weight: regular;

	text-decoration: none;
	text-align: center;

	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;

`;

function Home() {


  return (
    <DivHome>

      <IconTools height={"200px"} />
      <NavLink to="/team-generator" > Team Generator </NavLink>

    </DivHome>
  );
}

export default Home;
